import logo from './logo.svg';
import './App.css';
import Form from './Form';

import { Route, Switch } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <header className="App-header">
      <Route component={Form} />

      </header>
    </div>
  );
}

export default App;
